mapper.select:

select 

from tmmbumonnayosemi
where jcmsaimutegata_kbn = #{jcmsaimutegataKbn,jdbcType=CHAR}
  and jcmnayosekanri_cod = #{jcmnayosekanriCod,jdbcType=CHAR}
  and jcmbumon_cod = #{jcmbumonCod,jdbcType=CHAR}
  and jcmtekiyostr_ymd = #{jcmtekiyostrYmd,jdbcType=DATE}

mapper.delete:

delete from tmmbumonnayosemi
where jcmsaimutegata_kbn = #{jcmsaimutegataKbn,jdbcType=CHAR}
  and jcmnayosekanri_cod = #{jcmnayosekanriCod,jdbcType=CHAR}
  and jcmbumon_cod = #{jcmbumonCod,jdbcType=CHAR}
  and jcmtekiyostr_ymd = #{jcmtekiyostrYmd,jdbcType=DATE}

mapper.update:

