  and jcmnayosekanri_cod = #{jcmnayosekanriCod,jdbcType=CHAR}
  and jcmbumon_cod = #{jcmbumonCod,jdbcType=CHAR}
  and jcmtekiyostr_ymd = #{jcmtekiyostrYmd,jdbcType=DATE}


update tmmbumonnayosemi
